css:
.invisible-character {
  color: rgba(255, 255, 255, 0.1);
  text-shadow: none;
}
.editor .indent-guide {
  box-shadow: inset 1px 0 rgba(255, 255, 255, 0.1);
}
.leading-whitespace {
  color: rgba(255, 255, 255, 0.3);
  font-weight: 100;
}
.editor.is-focused .cursor {
  border-color: #f8f8f0;
}
.editor.is-focused .selection .region {
  background-color: #444;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: #333;
}
.editor,
.editor .gutter {
  background-color: #222222;
  color: #f8f8f0;
  text-shadow: 0 1px 0 #000;
  line-height: 1.4;
}
.editor .wrap-guide {
  background: #2f3030;
}
.editor.mini {
  text-shadow: none;
}
.comment {
  color: #6f705e;
}
.string {
  color: #e6d06c;
}
.keyword {
  color: #f12770;
}
.constant.numeric {
  color: #a77afe;
}
.comment {
  color: #6f705e;
}
.string {
  color: #e6d06c;
}
.constant.numeric {
  color: #a77afe;
}
.constant.language {
  color: #a77afe;
}
.constant.character,
.constant.other {
  color: #a77afe;
}
.keyword {
  color: #f12770;
}
.storage {
  color: #f12770;
}
.storage.type {
  font-style: italic;
  color: #76d9e6;
}
.entity.name.class {
  text-decoration: underline;
  color: #a6e22d;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #a6e22d;
}
.entity.name.function {
  color: #a6e22d;
}
.variable.parameter {
  font-style: italic;
  color: #fd971f;
}
.entity.name.tag {
  color: #f12770;
}
.entity.other.attribute-name {
  color: #a6e22d;
}
.support.function {
  color: #76d9e6;
}
.support.constant {
  color: #76d9e6;
}
.support.type,
.support.class {
  font-style: italic;
  color: #76d9e6;
}
.invalid {
  color: #f8f8f0;
  background-color: #f12770;
}
.invalid.deprecated {
  color: #f8f8f0;
  background-color: #a77afe;
}
.editor .gutter .line-number.git-line-modified {
  border-left-color: #fd971f;
}
.editor .gutter .line-number.git-line-deleted {
  border-left-color: #f12770;
}
.editor .gutter .line-number.git-line-added {
  border-left-color: #a6e22d;
}
.markup.heading {
  color: #a6e22d;
}
.markup.italic {
  font-style: italic;
  color: #76d9e6;
}
.markup.bold {
  font-weight: bold;
  color: #f12770;
}
.gfm .markup.underline {
  text-decoration: underline;
  color: #a6e22d;
}
.gfm.quote {
  font-style: italic;
  color: #bebec5;
}
.gfm.variable {
  color: #f12770;
}
.gfm.entity {
  color: #a77afe;
}
